description:
 MommysGirl - Tanya Tate, Alli Rae (Babysitters Playtime) 720p NEW September 05, 2015




Tanya Tate is excited for Alli Rae's visit today. Alli will be babysitting Tanya's daughter while she is gone for the day. Having Alli around the house again is nostalgic, bringing up old memories of when Tanya's now older daughters were still playing with dolls. Tanya missed those days and hoped for a reunion. Alli arrives, sitting beside a woman who practically raised her like her own, as they share memories from the good old days. Tanya insists Alli make herself at home, as Tanya prepares herself to leave. If Tanya only knew how far Alli would take her generosity...

